import React from 'react';
import Todos from './Components/Todos';
class App extends React.Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Bools',
        completed: false
      },
      {
        id: 3,
        title: 'Stools',
        completed: false
      },
    ]
  }
  render() {
      return (
    <div className="App">
     <Todos />
    </div>
  );
}
};

export default App;
